import React from 'react';
import './Sidebar.css';

const Sidebar = (props) =>
{
  const list = ['home', 'about me', 'contact','stream','misc'];

  const itemStyle ={
    height:(100*1.0/list.length)+'%',

  }

  const domlist = list.map((el,i) => 
    <p key={i} style={itemStyle}>
      {el}
    </p>);
    return (
        <div className="Sidebar">
          {domlist}
        </div>
    );
}

export default Sidebar
